import React, { useState, useEffect } from 'react';
import {
  Container,
  Typography,
  Box,
  CircularProgress,
  Alert,
  Tabs,
  Tab,
} from '@mui/material';
import axios from '../utils/axios';
import ExternalSearch from '../components/ExternalSearch';

const ExternalSearchPage = () => {
  const [tabValue, setTabValue] = useState(0);
  const [trending, setTrending] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchTrending();
  }, []);

  const fetchTrending = async () => {
    try {
      const response = await axios.get('/api/search/trending/external');
      setTrending(response.data.items);
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to fetch trending items');
    } finally {
      setLoading(false);
    }
  };

  const handleTabChange = (event, newValue) => {
    setTabValue(newValue);
  };

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        External Resources
      </Typography>

      <Tabs
        value={tabValue}
        onChange={handleTabChange}
        sx={{ mb: 4 }}
      >
        <Tab label="Search" />
        <Tab label="Trending" />
      </Tabs>

      {tabValue === 0 ? (
        <ExternalSearch />
      ) : (
        <Box>
          {loading ? (
            <Box display="flex" justifyContent="center" my={4}>
              <CircularProgress />
            </Box>
          ) : error ? (
            <Alert severity="error" sx={{ my: 2 }}>
              {error}
            </Alert>
          ) : (
            <ExternalSearch results={trending} readOnly />
          )}
        </Box>
      )}
    </Container>
  );
};

export default ExternalSearchPage;
